let CreateDatatableDotNet = (function () {
  let table;
  let currentPage = 0;
  let initTable1 = function () {
    table = $("#dataTable").DataTable({
      responsive: false,
      data: [],
      scrollY: "50vh",
      scrollX: true,
      scrollCollapse: true,
      columns: [
        { data: "id", className: "text-center" },
        { data: "name", className: "text-center" },
        { data: "number", className: "text-center" },
        { data: "team", className: "text-center" },
      ],
      order: [[2, "asc"]],
      columnDefs: [
        {
          targets: 0,
          title: "ID",
          orderable: false,
          render: function (data, type, full, meta) {
            return data;
          },
        },
        {
          targets: 1,
          title: "Name",
          render: function (data, type, full, meta) {
            return data;
          },
        },
        {
          targets: 2,
          title: "Number",
          render: function (data, type, full, meta) {
            return data;
          },
        },
        {
          targets: 3,
          title: "Team",
          render: function (data, type, full, meta) {
            return data;
          },
        },
      ],
    });
  };

  return {
    init: function () {
      initTable1();
      let containerTable = $(table.table().container());
    },
    data: function (data) {
      table.clear();
      table.rows.add(data);
      table.draw();
    },
    getData: function (index) {
      if (index) {
        return table.row(index).data();
      }
      return table.rows().data().toArray();
    },
    datatable: function () {
      return table;
    },
  };
})();
